import React from "react";
import WeatherIcon from "./WeatherIcon";

export default function ForecastDay(props) {
    return (
        <div>
            <div className="forecast-day">{props.data.dt}</div>
            <WeatherIcon code={props.data.weather[0].icon} size={48}/>
            <div className="forecast-temps">
                <span className="forecast-temps-max">{Math.round(props.data.temp.max)}°</span>
                <span className="forecast-temps-min">{Math.round(props.data.temp.min)}°</span>
            </div>
        </div>
    )

}
